window.bookSummaryJSON = "<p><b>This program is read by and includes a bonus conversation with the author.</b></p> <p><b>A powerful novel of brotherhood and the search for happiness from number one </b><b><i>New York Times</i></b><b> best-selling author, Jocko Willink.</b></p> <p>Johnny is stuck - living at home and watching after his brother while working as a stock boy is not what he dreamed about. But when he and his best friend, Goat, see an opportunity to break free of the monotony and take care of Johnny's brother all in one shot, they jump on it. Now they're on the run and about to find out the price for freedom.</p> <p>A moving and fast-paced thriller, <i>Final Spin</i> is a gripping exploration into brotherhood and sacrifice- straight from the dark heart of America.</p> <p><b>A Macmillan Audio production from St. Martin's Press </b></p>"; 
